const Footer=()=>{
    state={
        name:'',
        email:'',
        phone:'',
        course:'',
        sent:false
    }

    // handle input
handleName=(e)=>{
    this.setState({
        name:e.target.name
    })
}


handlEmail=(e)=>{
    this.setState({
        name:e.target.email
    })
}

handlePhone=(e)=>{
    this.setState({
        name:e.target.phone
    })
}

handleCourse=(e)=>{
    this.setState({
        name:e.target.course
    })
}





    return(
<>

