Uttarakhand 248121
</p>
<p className= 'phone'><i class="fa fa-phone fa-2 rem "></i>&nbsp; +91 88821-40688  |  +91 90840-63259</p>
<p className='email'><i class="fa fa-phone fa-2 rem"></i>&nbsp;&nbsp;&nbsp;info@brillicaservices.com </p>

        <img src={facebook} className="facebook"/>
         <img  src={linkdin} className="linkdin"/>
         <img src={twiter} className="twiter"/>
</div>

<div className='col-sm-2'>
<img src={Kiki} className='language_footer'/>
<p className='kiki'>LANGUAGE ZONE A UNIT OF BRILLICA SERVICES PVT.LTD.</p>
</div>

<div className='container-fluid'>
